import React, {Component} from 'react';
import {NavBar, Icon } from "antd-mobile";


class Top extends Component {
    render() {
        return (
            <div>
                <NavBar
                    mode="light"
                    icon={<Icon type="left" />}
                    onLeftClick={() => console.log('onLeftClick')}
                    rightContent={[
                        <Icon key="0" type="search" style={{ marginRight: '16px' }} />,
                ]}
                >购物车</NavBar>


            </div>
        );
    }
}

export default Top;
